// src/App.js
import React from 'react';
import { ThemeProvider, Box } from '@mui/material';
import theme from './theme';
import Navbar from './components/Navbar';
import News from './components/News';
import People from './components/People';
import Projects from './components/Projects';
import Publications from './components/Publications';
import Software from './components/Software';
import JoinUs from './components/JoinUs';
import Home from './components/Home';
import backgroundImage from './assets/bg.png'; // Ensure the image is correctly imported

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Box
        sx={{
          display: 'flex',
          flexDirection: 'column',
          minHeight: '100vh',
          background: `url(${backgroundImage}) no-repeat center center fixed`,
          backgroundSize: 'cover',
        }}
      >
        <Navbar />
        <Box sx={{ flex: '1 0 auto', overflowY: 'auto', width: '100%' }}>
          <Box id="home" sx={{ scrollMarginTop: '64px', width: '100%' }}>
            <Home />
          </Box>
          <Box id="news" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <News />
          </Box>
          <Box id="projects" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <Projects />
          </Box>
          <Box id="publications" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <Publications />
          </Box>
          <Box id="software" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <Software />
          </Box>
          <Box id="people" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <People />
          </Box>
          <Box id="join" sx={{ mt: 8, scrollMarginTop: '64px', width: '100%' }}>
            <JoinUs />
          </Box>
        </Box>
      </Box>
    </ThemeProvider>
  );
}

export default App;
